import React from 'react';

import user from "./user.jpg";

export const About = () => {
  return (
    <div className="text-center">
      <div className="mani">
        <h2>A. P. J. Abdul Kalam</h2>
        <div className="image-container">
          <img src={user} alt=
            "user" />
        </div>
        <p></p>
      </div>
    </div>

  )
};

export default About
